import React, { Component } from 'react';
import TextField from '@mui/material/TextField';





const SignIn = () => {
   
    return (
      <div>
      <TextField 
        id="standard-basic" 
        label="Standard" 
        variant="standard"
        sx={{

          width: { sm: 250, md: 350 },
      
          "& .css-1u9nrod-MuiFormControl-root-MuiTextField-root": {
            
            borderBottomColor:  "orange !important"
          }
        }} />
      </div>
    )
  
}

export default SignIn;
